import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 0 auto;
`;
const Title = styled.h1`
  color: black;
`;
export default () => {
  return (
    <div>
      <Container>
        <Title>Api Connected Website</Title>
      </Container>
    </div>
  );
};
